import React from 'react';
import styles from './Party.module.css';
import Image from 'next/image';

const Party = () => {
  return (
    <div className={styles.information}>
      <div className={styles.iceCreamImage}>
        <Image
          src="/shockedboy.png"
          alt="surprised boy"
          width={340}
          height={390}
        />
      </div>
    </div>
  );
};

export default Party;
